import React from "react";
import "./Thanks.css";
import axios from "axios";
import Pinknav from "../../Components/Pinknav/pinknav-right";
import Pinknavbutton from "../../Components/Pinknav/Pinknav-button";


function ThanksPage() {
    async function fetchCompliment() {
        try {
            const result = await axios.get('https://complimentr.com/api');
            console.log(result.data);
            console.log(`Hier is jouw persoonlijke boodschap: ${result.data.compliment}`)
        } catch (e) {
            console.error(e);
        }
    }

    fetchCompliment();

    return (
        <>
            <header>
                <Pinknavbutton

                    title='Welkom User'
                />

            </header>

        </>

    )
}


export default ThanksPage
